import React from "react";

const Benefit = () => {
  return (
    <div
      style={{
        marginLeft: "20px",
        border: "3px solid black",
        width: "670px",
        height: "120px",
        display: "flex",
        alignItems: "center",
        padding: "10px",
      }}
    >
      <p
        style={{ marginLeft: "10px", fontWeight: "bold", marginBottom: "5px" }}
      >
        Yang anda dapatkan di pelatihan ini :
      </p>
      <ul
        style={{
          display: "flex",
          flexDirection: "row",
          flexWrap: "wrap",         /* Wrap jika tidak cukup ruang */
          justifyContent: "flex-end",
          listStyle: "none",
          padding: 0,
          margin: 0,
        }}
      >
        <li
          style={{
            marginLeft: "10px",
            
            maxWidth: "50%",        /* Batasi lebar untuk menghindari keluar */
          }}
        >
          4 menit total video pembelajaran
        </li>
        <li
          style={{
            marginLeft: "10px",
            whiteSpace: "nowrap",
            maxWidth: "50%",
          }}
        >
          5 bahan bacaan
        </li>
        <li
          style={{
            marginLeft: "10px",
            whiteSpace: "nowrap",
            maxWidth: "50%",
          }}
        >
          5 konten dapat di unduh
        </li>
        <li
          style={{
            marginLeft: "10px",
            whiteSpace: "nowrap",
            maxWidth: "50%",
          }}
        >
          5 bahan bacaan
        </li>
        <li
          style={{
            marginLeft: "10px",
            whiteSpace: "nowrap",
            maxWidth: "50%",
          }}
        >
          5 konten dapat di unduh
        </li>
      </ul>
    </div>
  );
};

export default Benefit;
